import styles from './AddUser.module.css';
import Card from './reusable-blocks/Card';

const AddUser = () => {
    return <Card>
        <form onSubmit={submitHandler}>
            <label>Username</label>
            <input type="text"/>

            <label>Age (Years)</label>
            <input type="number"/>
        </form>
    </Card>
}

export default AddUser;
